import styled from "styled-components";

const Sidebar = styled.aside`
    width: 100px;
`;

const Aside = () => {
    return(
        <Sidebar>
            <label>
                <input type="checkbox"/>
                Scania
            </label>
            <label>
                <input type="checkbox"/>
                Volvo
            </label>
            <label>
                <input type="checkbox"/>
                Scania
            </label>
        </Sidebar>
    )
}
export default Aside;
